-- Table structure for homework
-- ----------------------------
DROP TABLE IF EXISTS `homework`;
CREATE TABLE `homework`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `course_id` int(11) NOT NULL COMMENT '课程ID',
  `course_name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '课程名称',
  `title` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '作业标题',
  `description` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '作业描述',
  `requirements` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '作业要求',
  `attachment_url` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '作业附件地址',
  `start_time` datetime NULL DEFAULT NULL COMMENT '开始时间',
  `deadline` datetime NOT NULL COMMENT '截止时间',
  `total_score` decimal(5, 2) NULL DEFAULT 100.00 COMMENT '总分',
  `submit_count` int(11) NULL DEFAULT 0 COMMENT '提交人数',
  `graded_count` int(11) NULL DEFAULT 0 COMMENT '批改人数',
  `average_score` decimal(5, 2) NULL DEFAULT 0.00 COMMENT '平均分',
  `status` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '未开始' COMMENT '作业状态',
  `create_time` datetime NOT NULL COMMENT '创建时间',
