-- Table structure for learning_features
-- ----------------------------
DROP TABLE IF EXISTS `learning_features`;
CREATE TABLE `learning_features`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `student_id` bigint(20) NOT NULL COMMENT '学生ID',
