  `homework_quality_score` decimal(5, 2) NULL DEFAULT NULL COMMENT '作业质量评分',
  `login_frequency` int(11) NULL DEFAULT NULL COMMENT '登录频率（次/周）',
  `login_regularity` decimal(6, 2) NULL DEFAULT NULL,
