  `risk_probability` decimal(5, 4) NULL DEFAULT NULL,
  `feature_vector` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '特征向量（JSON格式）',
  `created_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_lf_student_course_date`(`student_id`, `course_id`, `feature_date`) USING BTREE,
  INDEX `idx_risk_level_score`(`risk_level`, `risk_score`) USING BTREE,
  INDEX `idx_feature_date`(`feature_date`) USING BTREE,
  INDEX `idx_student_id`(`student_id`) USING BTREE,
  INDEX `idx_course_id`(`course_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 51 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '学生学习特征表' ROW_FORMAT = Dynamic;

