-- ----------------------------
-- Table structure for student_behavior
-- ----------------------------
DROP TABLE IF EXISTS `student_behavior`;
CREATE TABLE `student_behavior`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `student_id` int(11) NOT NULL COMMENT '学生ID',
  `student_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '学生姓名',
  `student_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '学生学号',
  `course_id` int(11) NOT NULL COMMENT '课程ID',
  `course_name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '课程名称',
  `behavior_date` date NOT NULL COMMENT '行为日期',
  `video_watch_time` int(11) NULL DEFAULT 0 COMMENT '视频观看时长(分钟)',
  `video_completion_rate` decimal(5, 2) NULL DEFAULT 0.00 COMMENT '视频完成率(%)',
  `homework_submit_count` int(11) NULL DEFAULT 0 COMMENT '作业提交次数',
  `homework_avg_score` decimal(5, 2) NULL DEFAULT 0.00 COMMENT '作业平均分',
  `login_count` int(11) NULL DEFAULT 0 COMMENT '登录次数',
  `last_login_time` datetime NULL DEFAULT NULL COMMENT '最后登录时间',
  `active_days` int(11) NULL DEFAULT 0 COMMENT '活跃天数',
  `total_online_time` int(11) NULL DEFAULT 0 COMMENT '总在线时长(分钟)',
  `focus_score` int(11) NULL DEFAULT 5 COMMENT '学习专注度评分(1-10)',
  `interaction_count` int(11) NULL DEFAULT 0 COMMENT '互动次数',
  `learning_progress` decimal(5, 2) NULL DEFAULT 0.00 COMMENT '学习进度(%)',
  `is_at_risk` tinyint(1) NULL DEFAULT 0 COMMENT '是否处于风险',
  `risk_probability` decimal(5, 4) NULL DEFAULT 0.0000 COMMENT '风险概率(0-1)',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_sb_student_course_date`(`student_id`, `course_id`, `behavior_date`) USING BTREE,
  INDEX `idx_student`(`student_id`) USING BTREE,
  INDEX `idx_course`(`course_id`) USING BTREE,
  INDEX `idx_date`(`behavior_date`) USING BTREE,
  INDEX `idx_risk`(`is_at_risk`) USING BTREE,
  INDEX `idx_student_course`(`student_id`, `course_id`) USING BTREE,
  INDEX `idx_date_risk`(`behavior_date`, `is_at_risk`) USING BTREE,
  CONSTRAINT `student_behavior_ibfk_1` FOREIGN KEY (`student_id`) REFERENCES `student` (`id`) ON DELETE CASCADE ON UPDATE RESTRICT,
  CONSTRAINT `student_behavior_ibfk_2` FOREIGN KEY (`course_id`) REFERENCES `course` (`id`) ON DELETE CASCADE ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 53 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '学生学习行为记录表' ROW_FORMAT = Dynamic;

