-- ----------------------------
-- View structure for system_health_view
-- ----------------------------
DROP VIEW IF EXISTS `system_health_view`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `system_health_view` AS select cast(`system_metrics`.`created_time` as date) AS `check_date`,`system_metrics`.`metric_name` AS `metric_name`,count(0) AS `execution_count`,avg(`system_metrics`.`execution_time`) AS `avg_execution_time`,sum((case when (`system_metrics`.`status` = 'SUCCESS') then 1 else 0 end)) AS `success_count`,sum((case when (`system_metrics`.`status` = 'FAILED') then 1 else 0 end)) AS `failed_count` from `system_metrics` where (`system_metrics`.`created_time` >= (now() - interval 7 day)) group by cast(`system_metrics`.`created_time` as date),`system_metrics`.`metric_name` order by `check_date` desc;

SET FOREIGN_KEY_CHECKS = 1;
